{"operationName":"jobs","variables":{"id":"101231773859476798","first":6},"query":"query jobs($id: ID!, $first: Int) {
  tool(id: $id) {
    jobsList(first: $first) {
      count
      edges {
        node {
          id
          angellistJobUrl
          title
          location
          services {
            ...serviceFields
            __typename
          }
          company {
            name
            imageUrl
            path
            __typename
          }
          __typename
        }
        __typename
      }
      pageInfo {
        endCursor
        hasNextPage
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment serviceFields on Tool {
  id
  name
  slug
  title
  verified
  imageUrl
  canonicalUrl
  path
  votes
  fans
  stacks
  following
  followContext
  __typename
}
"}
